// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//Realizamos el import para acceder a los guias de turistas
import "./Usuarios.sol";

//Este contrato se encarga de gestionar los atrigutos (variables) y métidos (funciones)
//básicos de los lugares requeridos en DApp Guanacaste Tours: Turistas y Guías.
contract Lugares {
    //Esto permite hacer referencia a la totalidad del contrato
    //Se hace una instancia del contrato "Usuarios" dentro de este contrato.
    Usuarios private usuariosContrato;

    mapping(uint256 => Lugar) private lugares;
    uint8 private contadorLugares;

    struct Lugar {
        string nombre;
        uint16 precio;
        uint8 cupos;
        address guiaTuristas;
        bool estado;
    }

    //Estos son los registros de eventos (son como auditirias) que se registran cuando se hacen
    //cambos significativos en los registros.
    event LugarRegistrado(string nombre);
    event LugarEliminado(string nombre);

    //Dentro del constructor realizamos la iniciación del Contrato relacionado con los usuarios
    //y se le asigna una dirreción al contrato. (es un address que hace referencia al contrato
    //en su totalidad, con confundir con la dirreción del dueño, un guía a turista).
    constructor(address _usuariosContrato) {
        usuariosContrato = Usuarios(_usuariosContrato);
    }

    //Valida que solo el dueño haga cambios.
    modifier soloDuenno() {
        require(
            msg.sender == obtenerDuenno(),
            "Solo el Duenno puede realizar esta accion"
        );
        _;
    }

    //Valida que solo los gúias de turistas puedan hacer cambios.
    modifier soloGuias() {
        require(
            msg.sender == obtenerDuenno() || obtenerGuia(msg.sender).estado,
            "Solo el Duenno o Guias de turistas puede realizar esta accion"
        );
        _;
    }

    //Hace un llamado al contrato de usuarios y se trae al dueño ya que es uno solo
    //para todo el sistema.
    function obtenerDuenno() public view returns (address) {
        return usuariosContrato.verDuenno();
    }

    function obtenerGuia(address _cuenta)
        public
        view
        returns (Usuarios.GuiaTuristas memory)
    {
        return usuariosContrato.verGuia(_cuenta);
    }

    function registrarLugar(
        string memory _nombre,
        uint16 _precio,
        uint8 _cupos,
        address _guiaTuristas
    ) public soloDuenno {
        //Realiza las validaciones para confirmar que se cumplen los requerimientos
        //antes de ingresar un nuevo lugar.
        require(
            obtenerGuia(_guiaTuristas).estado,
            "Deber ser un guia registrado"
        );
        require(_cupos > 0, "Debe tener al menos 1 cupo");
        require(_precio > 0, "Debe tener un precio mayor a 0");
        require(bytes(_nombre).length > 0, "Debe tener un nombre");
        require(
            _guiaTuristas != address(0),
            "Debe tener un guia de turistas asociado"
        );
        //Amenta el contador global de la cantidad de lugares y procede a agregar
        //un lugar en el mapping asignando el indice como clave.
        lugares[contadorLugares] = Lugar(
            _nombre,
            _precio,
            _cupos,
            _guiaTuristas,
            true
        );
        contadorLugares++;
        emit LugarRegistrado(_nombre);
    }

    function verLugar(string memory _nombre)
        public
        view
        returns (Lugar memory)
    {
        //Recorre el mapping para encontrar el lugar con el nombre indicado.
        Lugar memory _lugar;
        for (uint8 i = 0; i < contadorLugares; i++) {
            //Se hace uso de la función keccak256 para hacer una comparación de cadenas.
            //Esto porque el resulatado del mapping es un string Storage y el del parámetro
            //un string memory y es necesario parsear para que sean de un formato similar
            //y poder ser comparados.
            if (
                keccak256(abi.encodePacked(lugares[i].nombre)) ==
                keccak256(abi.encodePacked(_nombre))
            ) {
                _lugar = lugares[i];
            }
        }
        return (_lugar);
    }

    function verLugares() public view returns (Lugar[] memory _resultado) {
        //A la hora de ver lo lugares, se espera solo mostrar los lugares registrados
        //en estado activos (Estado = true). Así que lo que hacemos es contar la cantidad
        //de lugares activos para saber el tamaño del arrego que debemos mostrar.
        uint8 _totalActivos = 0;
        for (uint8 i = 0; i < contadorLugares; i++) {
            lugares[i].estado ? _totalActivos++ : _totalActivos;
        }
        //Una vez definido el arreglo, recorremos el mapping y a este le asignamos solo
        //los lugares con activos (Estado = true).
        _resultado = new Lugar[](_totalActivos);
        uint8 _contador = 0;
        for (uint8 i = 0; i < contadorLugares; i++) {
            if (lugares[i].estado) {
                _resultado[_contador] = lugares[i];
                _contador++;
            }
        }
        return _resultado;
    }

    function eliminarLugar(string memory _nombre) public soloDuenno {
        for (uint8 i = 0; i < contadorLugares; i++) {
            if (
                keccak256(abi.encodePacked(lugares[i].nombre)) ==
                keccak256(abi.encodePacked(_nombre))
            ) {
                lugares[i].estado = false;
                emit LugarEliminado(_nombre);
            }
        }
    }
}

contracts/Usuarios.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//Este contrato se encarga de gestionar los atrigutos (variables) y métidos (funciones)
//básicos de los 2 tipos de usuarios requeridos en DApp Guanacaste Tours: Turistas y Guías.
contract Usuarios {
    //Dueño de la agencia de turismo.
    address private immutable duenno;

    //Listas  de direcciones de turistas y guias (Esto es para itereación y listas
    //ya que en solidity no se puede recorrer un mapping).
    address[] private listaGuiaTuristas;
    address[] private listaTuristas;

    //Arreglos (listas) de los 2 tipos de usuarios.
    mapping(address => GuiaTuristas) private guiasRegistrados;
    mapping(address => Turista) private turistasRegistrados;

    //Un Objeto de tipo GuiaTuristas con sus variables básicas.
    struct GuiaTuristas {
        address cuenta;
        string nombreCompleto;
        bool estado;
    }
    //Un Objeto de tipo Turista con sus variables básicas.
    struct Turista {
        address cuenta;
        string nombreCompleto;
        //uint8 que va de 0 a 255
        uint8 edad;
        bool estado;
    }

    //Estos son los registros de eventos (son como auditirias) que se registran cuando se hacen
    //cambos significativos en los registros.
    event GuiaRegistrado(address cuenta, string nombre);
    event GuiaEliminado(address cuenta);
    event TuristaRegistrado(address cuenta, string nombre);
    event TuristaEliminado(address turista);

    constructor() {
        duenno = msg.sender;
    }

    //Valida que solo el dueño haga cambios.
    modifier soloDuenno() {
        require(
            msg.sender == duenno,
            "Solo el Duenno puede realizar esta accion"
        );
        _;
    }

    //Valida que solo los gúias de turistas puedan hacer cambios.
    modifier soloGuias() {
        require(
            msg.sender == duenno || guiasRegistrados[msg.sender].estado,
            "Solo el Duenno o Guias de turistas puede realizar esta accion"
        );
        _;
    }

    function registrarGuiaTurista(address _cuenta, string memory _nombre)
        public
        soloDuenno
    {
        require(
            !guiasRegistrados[_cuenta].estado,
            "Guia de Turistas ya esta registrado"
        );
        guiasRegistrados[_cuenta] = GuiaTuristas(_cuenta, _nombre, true);
        //La función de guardar en esta lista es solo para poder hacer iteraciones en las funciones tipo view.
        listaGuiaTuristas.push(_cuenta);
        emit GuiaRegistrado(_cuenta, _nombre);
    }

    function registrarTurista(
        address _cuenta,
        string memory _nombre,
        uint8 _edad
    ) public soloGuias {
        require(
            !turistasRegistrados[_cuenta].estado,
            "Turista ya esta registrado"
        );
        turistasRegistrados[_cuenta] = Turista(_cuenta, _nombre, _edad, true);
        //La función de guardar en esta lista es solo para poder hacer iteraciones en las funciones tipo view.
        listaTuristas.push(_cuenta);
        emit TuristaRegistrado(_cuenta, _nombre);
    }

    function verDuenno() public view returns (address) {
        return duenno;
    }

    function verGuia(address _cuenta) public view returns (GuiaTuristas memory) {
        require(guiasRegistrados[_cuenta].estado, "Guia no existe");
        return guiasRegistrados[_cuenta];
    }

    function verTurista(address _cuenta) public view returns (Turista memory) {
        require(turistasRegistrados[_cuenta].estado, "Turista no existe");
        return turistasRegistrados[_cuenta];
    }

    //En esta función se retorna una lista de objetos tipo GuiaTuristas.
    function verGuias()
        public
        view
        soloDuenno
        returns (GuiaTuristas[] memory _resultado)
    {
        //Contamos la coantidad de guias activos
        uint8 _totalActivos = 0;
        for (uint8 i = 0; i < listaGuiaTuristas.length; i++) {
            guiasRegistrados[listaGuiaTuristas[i]].estado
                ? _totalActivos++
                : _totalActivos;
        }
        //Se crea un arreglo de objetos tipo GuiaTuristas con el tamaño de la lista de guias.
        _resultado = new GuiaTuristas[](_totalActivos);
        //Se recorre la listaGuiaTuristas para obtener los address y con ellos obtener el resto de la información
        //de cada guia en el mapping guiasRegistrados.
        uint8 _constador = 0;
        for (uint8 i = 0; i < listaGuiaTuristas.length; i++) {
            //Solo se agregan a la lista los guias que estén activos (estado = true).
            if (guiasRegistrados[listaGuiaTuristas[i]].estado) {
                _resultado[_constador] = guiasRegistrados[listaGuiaTuristas[i]];
                _constador++;
            }
        }
        return _resultado;
    }

    //No le agrego documentación porque es igual a la función anterior
    function verTuristas()
        public
        view
        soloGuias
        returns (Turista[] memory _resultado)
    {
        uint16 _totalActivos = 0;
        for (uint16 i = 0; i < listaTuristas.length; i++) {
            turistasRegistrados[listaTuristas[i]].estado
                ? _totalActivos++
                : _totalActivos;
        }

        _resultado = new Turista[](_totalActivos);
        uint16 _constador = 0;
        for (uint16 i = 0; i < listaTuristas.length; i++) {
            //Solo se agregan a la lista los guias que estén activos (estado = true).
            if (turistasRegistrados[listaTuristas[i]].estado) {
                _resultado[_constador] = turistasRegistrados[listaTuristas[i]];
                _constador++;
            }
        }

        return _resultado;
    }

    function eliminarGuiaTurista(address _cuenta) public soloDuenno {
        //Si el estado del Guia de Tusitas es inactivo (estado = False), entonces ya está eliminado.
        require(guiasRegistrados[_cuenta].estado, "Guia no existe");
        guiasRegistrados[_cuenta].estado = false;
        emit GuiaEliminado(_cuenta);
    }

    function eliminarTurista(address _cuenta) public soloGuias {
        //Si el estado del  Tusitas es inactivo (estado = False), entonces ya está eliminado.
        require(turistasRegistrados[_cuenta].estado, "Turista no existe");
        turistasRegistrados[_cuenta].estado = false;
        emit TuristaEliminado(_cuenta);
    }
}

